import React, { Component } from 'react';
// import { Route } from 'react-router';
import * as pages  from './pages';
// import Login from './pages/Login';
// import Teacher from './pages/Teacher';
// import Learn from './pages/Learn';
// import Test from './pages/Test';
// import Student from './pages/Student';
import { Switch, Route } from 'react-router-dom';

import './App.css';


//export default  class App extends Component {
//	render() {
//		return (
//			<Home />
//		 );
//	 }
// }
const Main = () => (
    <Switch>
		<Route exact  path='/' component={pages.Home}></Route>
		<Route exact  path='/learn' component={pages.Learn}></Route>
		<Route exact  path='/test' component={pages.Test}></Route>
		<Route exact  path='/login' component={pages.Login}></Route>
		<Route exact  path='/teacher' component={pages.Teacher}></Route>
		<Route exact  path='/student' component={pages.Student}></Route>
	</Switch>
);

export default Main;
